import ReactPlayer from 'react-player';

import styles from './ModalWindov.module.scss';

const Modal = ({ open, setOpen, children }) => (
  <div className={`'overlay animated' ${open ? styles.show : ''}`}>
    <div className={styles.modal}>
      <svg onClick={() => setOpen(false)} height="200" viewBox="0 0 200 200" width="200">
        <title />
        <path d="M114,100l49-49a9.9,9.9,0,0,0-14-14L100,86,51,37A9.9,9.9,0,0,0,37,51l49,49L37,149a9.9,9.9,0,0,0,14,14l49-49,49,49a9.9,9.9,0,0,0,14-14Z" />
      </svg>
      {children}
    </div>
  </div>
);

const ModalWindov = () => {
  const [open, setOpen] = React.useState(false);
  return (
    <div>
      <div className={styles.AppModal}>
        <button onClick={() => setOpen(true)} className={styles.openModalBtn}>
          ✨ Открыть окно
        </button>
        <Modal open={open} setOpen={setOpen}>
          <div className={styles.img}>
            <ReactPlayer url="https://www.youtube.com/watch?v=06bh14iY3dA&list=PL0FGkDGJQjJG9eI85xM1_iLIf6BcEdaNl&index=21" />
          </div>
          {/* <h3>Is okay!!!!</h3> */}
          {/* <button className={styles.buttonModal}>Serasch</button> */}
        </Modal>
      </div>
    </div>
  );
};

export default ModalWindov;
